import React from "react";
// import { FcLike } from "react-icons/fc";
import { FcLikePlaceholder } from "react-icons/fc";

const Card = ({ data }) => {
  return (
    <div className="Card border-green-50 rounded-lg relative">
      <div>
        <div className="relative ">
          <img src={data.image.url} alt={data.title} className=" rounded-lg " />
          <div className="absolute bottom-1 right-2">
            <button>
              <FcLikePlaceholder fontSize="1.75rem" />
            </button>
          </div>
        </div>
        <div className="px-5 pb-5">
          <p className="font-bold mb-2 ">{data.title}</p>
          <p className=" text-neutral-500 text-sm">{data.description}</p>
        </div>
      </div>
    </div>
  );
};

export default Card;
